import React, {Component} from 'react';
import Chart1 from './Chart1';
import {withStyles} from "@material-ui/core/styles";
import Pager from "@material-ui/core/Paper";

const styles = theme => ({
    root: {
        width : '100%',
        minWidth : 1080,
        height : '100%',
        backgroundColor : '#eeeeee'
    },
    menu:{
        marginTop : 15,
        marginBottom : 15,
        display:'flex',
        justifyContent: 'center'
    },
    userTitle:{
        marginTop : 15,
        marginBottom : 15,
        justifyContent: 'center'
    },
    paper:{
        marginLeft: 18,
        marginRight: 18,
        marginTop : 18,
    },
    progress:{
        margin: theme.spacing(1) * 2
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
        display: 'none',
        [theme.breakpoints.up('sm')]: {
            display: 'block',
        },
    },
    subTitle:{
        flexGrow: 1,
        display: 'none',
        [theme.breakpoints.up('sm')]: {
            display: 'block',
        },
        marginLeft : 40,
        marginTop : 20,
        marginBottom : 20
    },
    tableHead:{
        fontSize: '1.5rem',
        justifyContent : 'center',
        textAlign : 'center',
        width : '20%',
        height: '25px',
        backgroundColor : '#f5fffa'
    },
    check:{
        marginLeft: 5,
        marginRight: 5,
        marginBottom:5,
        marginTop:5,
        width : '11%',
        height : '100px',
        backgroundColor : '#a8daf9',
        fontSize : '1.5rem'
    },
    checked:{
        marginLeft: 5,
        marginRight: 5,
        marginBottom:5,
        marginTop:5,
        width : '11%',
        height : '100px',
        backgroundColor : '#CA6573',
        fontSize : '1.5rem'
    },
    none:{
        marginLeft: 5,
        marginRight: 5,
        marginBottom:5,
        marginTop:5,
        width : '11%',
        height : '100px',
        backgroundColor : '#eeeeee',
        fontSize : '1.5rem'
    }
})

class Page8 extends Component {
    render() {
        return (
            <div>
                <Chart1/>
            </div>
        );
    }
}
export default withStyles(styles)(Page8);
